import React from 'react';
import "./App" ;
import {LinK} from "react-router-dom";

class Nav extends React.Component{
    render() {
        return (<nav>
            <h3>Logo</h3>
            <ul className='nav-links'>
                <LinK to='/Register'>
                    <li>Register</li>
                </LinK>
            </ul>
        </nav>)
    }
}
